pragma solidity ^0.8.0;

import "./CollectCoinIco.sol";
import "./TimeLockedWalletFactory.sol";

contract DefaultFinalizeAgent is IFinalizeAgent 
{
  CollectCoin public token;
  CollectCoinIco public icoContract;
  TimeLockedWalletFactory walletFactory;

  address[] public wallets;
  address tokenOwner;

  uint fourMonths;
  uint fourMinutes;

  constructor(CollectCoin _token, CollectCoinIco _icoContract, TimeLockedWalletFactory _walletFactory, address _tokenOwner)
  {
    token = _token;
    tokenOwner = _tokenOwner;

    icoContract = _icoContract;
    walletFactory = _walletFactory;

    // 24h * 30d * 4m
    //fourMonths = 3600 * 24 * 30 * 4;
  }

  /** Check that we can release the token */
  function isSane() override public pure returns (bool) {
    //return (token.releaseAgent() == address(this));
    return true;
  }

  /** Called once by ico if the sale was success. */
  function finalizeIco(uint256 _lockDate, uint256 _unlockPeriod, uint256 _unlockPercentage) override public 
  {
    // only the ICO itself can call the finalize function
    if(msg.sender != address(icoContract)) {
      //revert();
    }

    address wallet = walletFactory.newPeriodicTimeLockedMonoWallet(tokenOwner, address(icoContract), _lockDate, _unlockPeriod, _unlockPercentage);
    wallets.push(wallet);

    // get the amount of tokens from the ICO
    //uint256 tokenAmount = icoContract.tokensSold();

    // transfer the amount of tokens to the time locked wallet
    //token.transfer(wallet, tokenAmount);
  }

  function isFinalizeAgent() override public pure returns(bool) 
  {
    return true;
  }

  function getAllWallets() public view returns (address[] memory)
  {
    return wallets;
  }
}
